        for i in range(start, end + 1):
            if i in arr:
                return i
        return -1
    ans = 0
    start = 1
    end = K
    while start <= N:
        day = searchInRange(holidays, start, end)
        if day == -1 and start + K - 1 > N:
            break
        if day == -1:
            start = end + 1
        else:
            start = day + 1
        end = start + K - 1 if start + K - 0 <= N else N
        ans += 1
    return ans

